pma:database.pma:function:
CREATE DEFINER=`root`@`localhost` FUNCTION `GetIdEightDigit`(LastIndexId nvarchar(8)) RETURNS varchar(8) CHARSET utf8 COLLATE utf8_general_ci
BEGIN

  DECLARE ID nvarchar(5);
  DECLARE TitleID nvarchar(3);
  DECLARE LastID nvarchar(8);
  SET TitleID := SUBSTR(LastIndexId, 1, 3);
  SET ID := SUBSTR(LastIndexId, 4, 8);

SELECT
  CONCAT(TitleID, LPAD(ID + 1, 5, 0)) INTO LastID
FROM DUAL;
--   SELECT
--     SUBSTR(LastIndexId, 0, 3) + SUBSTR(LastIndexId, 4, 8) + 1 INTO LastID
--   FROM DUAL;

  RETURN LastID;
END

CREATE DEFINER=`root`@`localhost` FUNCTION `GetIdFourDigit`(LastIndexId nvarchar(4)) RETURNS varchar(4) CHARSET utf8 COLLATE utf8_general_ci
BEGIN
  DECLARE ID nvarchar(3);
  DECLARE TitleId nvarchar(1);
  DECLARE LastId nvarchar(4);
  SET ID := SUBSTR(LastIndexId, 2, 4);
  SET TitleId := SUBSTR(LastIndexId, 1, 1);
SELECT
  CONCAT(TitleId, LPAD(ID + 1, 3, 0)) INTO LastId
FROM DUAL;
--   SELECT
--     SUBSTR(LastIndexId, 1, 1) + SUBSTR(LastIndexId, 2, 3) + 1 INTO LastId
--   FROM DUAL;
  RETURN LastId;
END

pma:database.pma:procedure:
CREATE DEFINER=`root`@`localhost` PROCEDURE `AdminInviceView`(IN P_CMD nvarchar(10), IN P_ID nvarchar(8), IN P_Customer nvarchar(8), IN P_Staff nvarchar(8), IN P_Amount DECIMAL(10, 0), IN P_Status nvarchar(1)) BEGIN DECLARE V_ID nvarchar(8); DECLARE V_IDD nvarchar(8); IF(P_CMD = 'GET_ALL')THEN SELECT t.Id, CONCAT(cus.LastName, ' ', cus.FirstName) AS FullName, t.Date, t.Amount, t.Status FROM tblinvoice t INNER JOIN tblcustomer cus ON t.CustomerName = cus.Id; ELSEIF (P_CMD = 'GET_BID') THEN SELECT t.Id, cus.LastName, cus.FirstName, t.Date, t.Amount, t.Status FROM tblinvoice t INNER JOIN tblcustomer cus ON t.CustomerName = cus.Id WHERE t.Id = P_ID; ELSEIF (P_CMD = 'GET_CID') THEN SELECT t.Id, cus.LastName, cus.FirstName, t.Date, t.Amount, t.Status FROM tblinvoice t INNER JOIN tblcustomer cus ON t.CustomerName = cus.Id WHERE t.CustomerName = P_Customer; ELSEIF (P_CMD = 'INSERT') THEN CALL GetRecordId('tblinvoice', 1); SELECT t.LastId INTO V_ID FROM tblrecordid t WHERE t.RecordName = 'tblinvoice'; CALL GetRecordId('tblinvoicedetails', 1); SELECT t.LastId INTO V_IDD FROM tblrecordid t WHERE t.RecordName = 'tblinvoicedetails'; INSERT INTO tblinvoicedetails (Id, InvoiceNumber, Product, Qty, Price, Amount, Status) SELECT V_IDD, V_ID, Product, Qty, Price, Qty * Price AS Amount, '1' FROM tblfavorite WHERE USER = P_Customer;
DELETE FROM tblfavorite WHERE USER = P_Customer;
INSERT INTO tblinvoice (Id, CustomerName, Date, StaffName, Amount, Status) VALUES (V_ID, P_Customer, SYSDATE(), P_Staff, P_Amount, P_Status);
SELECT V_ID FROM dual; ELSEIF (P_CMD = 'UPDATE') THEN UPDATE tblinvoice SET CustomerName = P_Customer, Date = SYSDATE, StaffName = P_Staff, Amount = P_Amount, Status = P_Status WHERE Id = P_ID; ELSEIF (P_CMD = 'DELETE') THEN DELETE FROM tblinvoice WHERE Id = P_ID; DELETE FROM tblinvoicedetails WHERE InvoiceNumber = P_ID; END IF; END

CREATE DEFINER=`root`@`localhost` PROCEDURE `AdminProductView`(IN P_CMD nvarchar(10), IN P_ID nvarchar(8), IN P_Item nvarchar(100), IN P_Description nvarchar(250), IN P_Category nvarchar(250), IN P_SubCategory nvarchar(250)) BEGIN
DECLARE V_ID nvarchar(8); IF (P_CMD = 'GET_ALL') THEN SELECT t.Id, t.Item, t.Description, t.Category FROM tblproducts t; ELSEIF (P_CMD = 'GET_BY') THEN SELECT t.Id, t.Item, t.Description, t.Category FROM tblproducts t WHERE t.Id = P_ID; ELSEIF (P_CMD = 'INSERT') THEN CALL GetRecordId('tblproducts', 1); SELECT t.LastId INTO V_ID FROM tblrecordid t WHERE t.RecordName = 'tblproducts'; INSERT INTO tblproducts (Id, Item, Description, Category) VALUES (V_ID, P_Item, P_Description, P_Category); ELSEIF (P_CMD = 'UPDATE') THEN UPDATE tblproducts t SET Item = P_Item, Description = P_Description, Category = P_Category WHERE t.Id = P_ID; ELSEIF (P_CMD = 'DELETE') THEN DELETE FROM tblproducts WHERE Id = P_ID; ELSEIF (P_CMD = 'GET_SCAT') THEN SELECT t.Id, t.SubCategory, t.Category FROM tblsubcategory t; ELSEIF (P_CMD = 'GET_SCID') THEN SELECT t.Id, t.SubCategory, t.Category FROM tblsubcategory t WHERE t.Id = P_ID; ELSEIF (P_CMD = 'INSERTSC') THEN CALL GetRecordId('tblsubcategory', 1); SELECT t.LastId INTO V_ID FROM tblrecordid t WHERE t.RecordName = 'tblsubcategory'; INSERT INTO tblsubcategory (Id, SubCategory, Category) VALUES (V_ID, P_SubCategory, P_Category); ELSEIF (P_CMD = 'UPDATESC') THEN UPDATE tblsubcategory t SET SubCategory = P_SubCategory, Category = P_Category WHERE t.Id = P_ID; ELSEIF (P_CMD = 'DELETESC') THEN DELETE FROM tblsubcategory WHERE Id = P_ID; ELSEIF (P_CMD = 'GET_CAT') THEN SELECT t.Id, t.Category FROM tblcategory t; ELSEIF (P_CMD = 'GET_CID') THEN SELECT t.Id, t.Category FROM tblcategory t WHERE t.Id = P_ID; ELSEIF (P_CMD = 'INSERTC') THEN CALL GetRecordId('tblcategory', 1); SELECT t.LastId INTO V_ID FROM tblrecordid t WHERE t.RecordName = 'tblcategory'; INSERT INTO tblcategory (Id, Category) VALUES (V_ID, P_Category); ELSEIF (P_CMD = 'UPDATEC') THEN UPDATE tblcategory t SET Category = P_Category WHERE t.Id = P_ID; ELSEIF (P_CMD = 'DELETEC') THEN DELETE FROM tblcategory WHERE Id = P_ID; END IF;
END

CREATE DEFINER=`root`@`localhost` PROCEDURE `AdminPromoionView`(IN P_CMD nvarchar(10),IN P_Id NVARCHAR(8),IN P_Percentage nvarchar(5),IN P_Image nvarchar(8),
IN P_FileName nvarchar(500),
IN P_FilePath nvarchar(100),
IN P_FileSize nvarchar(10))
BEGIN
  DECLARE V_ID nvarchar(8);
  IF(P_CMD = 'GET_ALL')THEN
    SELECT POP.Id, POP.Percetage, IBH.FileName FROM tblpromotionpercetage POP LEFT JOIN tblimagebranch IBH ON POP.Image = IBH.Id;
  ELSEIF(P_CMD = 'GET_BID') THEN 
     SELECT POP.Id, POP.Percetage, IBH.FileName FROM tblpromotionpercetage POP LEFT JOIN tblimagebranch IBH ON POP.Image = IBH.Id WHERE POP.Id = P_Id;
  ELSEIF(P_CMD = 'INSERT') THEN 
     SET V_ID := GetRecordId('tblbranch', 1);
     INSERT INTO tblpromotionpercetage (Id, Percetage, Image)
       VALUES (V_ID, P_Percentage, P_Image);
ELSEIF (P_CMD = 'INSERTI') THEN
CALL GetRecordId('tblimagebranch', 1);
SELECT
  t.LastId INTO V_ID
FROM tblrecordid t
WHERE t.RecordName = 'tblimagebranch';
INSERT INTO tblimagebranch (Id, FileName, Type, FileSize)
  VALUES (V_ID, P_FileName, P_FilePath, P_FileSize);
  ELSEIF(P_CMD = 'UPDATE')THEN
    UPDATE tblpromotionpercetage SET Percetage = P_Percentage,
                                     Image = P_Image
                      WHERE Id = P_Id;
  ELSEIF(P_CMD = 'DELETE')THEN
    DELETE FROM tblpromotionpercetage WHERE Id = P_Id;
ELSEIF (P_CMD = 'GET_FID') THEN
SELECT
  t.LastId
FROM tblrecordid t
WHERE t.RecordName = 'tblimagebranch';
  END IF;
END

CREATE DEFINER=`root`@`localhost` PROCEDURE `AdminShopView`(IN P_CMD nvarchar(10), IN P_ID nvarchar(8), IN P_Shop nvarchar(50), IN P_Description nvarchar(500), IN P_ShopLogo nvarchar(8), IN P_ShopRate decimal) BEGIN
DECLARE V_ID nvarchar(8); IF (P_CMD = 'GET_ALL') THEN SELECT t.Id, t.ShopName, t.Description, t1.FileName, t.ShopRate FROM tblshop t INNER JOIN tblimagebranch t1 ON t.ShopLogo = t1.Id; ELSEIF (P_CMD = 'GET_BID') THEN SELECT t.Id, t.ShopName, t.Description, t1.FileName, t.ShopRate FROM tblshop t INNER JOIN tblimagebranch t1 ON t.ShopLogo = t1.Id WHERE t.Id = P_ID; ELSEIF (P_CMD = 'INSERT') THEN CALL GetRecordId('tblshop', 1); SELECT t.LastId INTO V_ID FROM tblrecordid t WHERE t.RecordName = 'tblshop'; INSERT INTO tblshop (Id, ShopName, Description, ShopLogo, ShopRate) VALUES (V_ID, P_Shop, P_Description, P_ShopLogo, P_ShopRate); ELSEIF (P_CMD = 'UPDATE') THEN UPDATE tblshop t SET ShopName = P_Shop, Description = P_Description, ShopLogo = P_ShopLogo, ShopRate = P_ShopRate WHERE t.Id = P_ID; ELSEIF (P_CMD = 'DELETE') THEN DELETE FROM tblshop WHERE Id = P_ID; END IF;
END

CREATE DEFINER=`root`@`localhost` PROCEDURE `LoginSignup`(IN P_CMD nvarchar(10), IN P_ID nvarchar(8), IN P_LastName nvarchar(50), IN P_FirstName nvarchar(50), IN P_Gender nvarchar(1), IN P_DateOfBirth nvarchar(10), IN P_PhoneNumber varchar(10), IN P_Email varchar(100), IN P_JobTitle varchar(100), IN P_Country varchar(8), IN P_Province varchar(8), IN P_District varchar(8), IN P_Commnues varchar(8), IN P_Villages varchar(8), IN P_Street varchar(25), IN P_House nvarchar(10), IN P_Password nvarchar(250)) BEGIN
DECLARE V_ID nvarchar(8);
IF (P_CMD = 'LOGIN') THEN SELECT t.Id, t.LastName, t.FirstName, t.Gender, t.DateOfBirth, t.PhoneNumber, t.Email, t.JobTitle, t.Country, t.Province, t.District, t.Commnues, t.Villages, t.Street, t.House, t.Password FROM tblcustomer t WHERE t.Email = P_Email AND t.Password = P_Password; ELSEIF (P_CMD = 'SIGNUP') THEN SELECT t.LastId INTO V_ID FROM tblrecordid t WHERE t.RecordName = 'tblcustomer'; INSERT INTO tblcustomer (Id, LastName, FirstName, Gender, DateOfBirth, PhoneNumber, Email, JobTitle, Country, Province, District, Commnues, Villages, Street, House, Password) VALUES (V_ID, P_LastName, P_FirstName, P_Gender, P_DateOfBirth, P_PhoneNumber, P_Email, P_JobTitle, P_Country, P_Province, P_District, P_Commnues, P_Villages, P_Street, P_House, P_Password); ELSEIF (P_CMD = 'COU') THEN SELECT t.Id, t.Country FROM tblcountry t; ELSEIF (P_CMD = 'PRO') THEN SELECT t.Id, t.Province FROM tblprovinces t WHERE t.CountryCode = P_Country; ELSEIF (P_CMD = 'DIS') THEN SELECT t.Id, t.Distict FROM tbldistricts t WHERE t.ProvinceCode = P_Province; ELSEIF (P_CMD = 'COM') THEN SELECT t.Id, t.Communes FROM tblcommunes t WHERE t.DistrictCode = P_District; ELSEIF (P_CMD = 'VIL') THEN SELECT t.Id, t.Villages FROM tblvillages t WHERE t.CommunesCode = P_Commnues; END IF; END

CREATE DEFINER=`root`@`localhost` PROCEDURE `ProvincesView`(IN P_CMD nvarchar(10), IN P_ID nvarchar(8), IN P_Province nvarchar(100), IN P_KhmerProvince nvarchar(250), IN P_CountryCode nvarchar(8), IN P_ISO nvarchar(10)) BEGIN DECLARE LastID nvarchar(8);
IF (P_CMD = 'GET_ALL') THEN SELECT t.Id, t.Province, t.KhmerProvince, t.CountryCode, t.ISO FROM tblprovinces t; ELSEIF (P_CMD = 'GET_ID') THEN SELECT t.Id, t.Province, t.KhmerProvince, t.CountryCode, t.ISO FROM tblprovinces t WHERE t.Id = P_ID; ELSEIF (P_CMD = 'INSERT') THEN SELECT MAX(t.Id) INTO LastID FROM tblprovinces t; INSERT INTO tblprovinces (Id, Province, KhmerProvince, CountryCode, ISO) VALUES (GetIdEightDigit(LastID), P_Province, P_KhmerProvince, P_CountryCode, P_ISO); ELSEIF (P_CMD = 'UPDATE') THEN UPDATE tblprovinces t SET t.Province = P_Province, t.KhmerProvince = P_KhmerProvince, t.CountryCode = P_CountryCode, t.ISO = P_ISO WHERE t.Id = P_ID; ELSEIF (P_CMD = 'DELETE') THEN DELETE LOW_PRIORITY QUICK FROM tblprovinces WHERE Id = P_ID; END IF;
END
